import "./styles/reset.css";
import "./styles/main.css";
import Header from './header/header.js';
import Footer from './footer/footer.js';

function App() {
  return (
    <div className="App">
        <Header />
        <div className='main'>
          <h1>Hello World</h1>
        </div>
        <Footer />
    </div>
  );
}

export default App;
